import { Link } from 'react-router-dom';
import './ShelterItem.css';
import Paper from '@material-ui/core/paper';

function ShelterItem({ shelter: {id, name, city, avatar, pets}}) {



    return(
        <div className="d-flex align-items-center justify-content-around">
            <div className="justify-content-start">
                
            </div>
            <Paper elevation={3} className="d-flex flex-column">
                <img className="shelter-img-container" src={avatar} alt={name}/>
                <h5><i className="fas fa-user"></i>{name}</h5>
                <h5><i className="fas fa-map-marker-alt"></i>{city}</h5>
                <h5><i className="fas fa-paw"></i>{pets.length}</h5>
            </Paper>
        </div>
        
        
    );
}

export default ShelterItem;

